import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Cards4 from '../Cards3'

function Invoice() {
  return (
    <>
      <HeroSection />
      <Cards4 />
      <Footer />
    </>
  );
}

export default Invoice;
